class FABSUser:
    def __init__(self):
        self.submissions = []
        self.duns_validation_rules = lambda duns: len(duns) == 9 and duns.isdigit()

    def submit_record(self, duns, data):
        if self.duns_validation_rules(duns):
            record = {
                'duns': duns,
                'data': data,
                'status': 'Submitted'
            }
            self.submissions.append(record)
            return "Submission successful."
        else:
            return "Validation error: Invalid DUNS number."

    def view_submission_history(self):
        return self.submissions


class Developer:
    def __init__(self, user: FABSUser):
        self.user = user

    def update_validation_rules(self, new_rules):
        self.user.duns_validation_rules = new_rules


class DataUser:
    def __init__(self):
        self.records = []

    def receive_updates(self):
        # For simplicity, we return records updated today
        today_records = [record for record in self.records if record['updated_today']]
        return today_records


class Broker:
    def __init__(self):
        self.records = []

    def upload_and_validate_records(self, records):
        errors = []
        for record in records:
            if not self.validate_duns(record['duns']):
                errors.append(f"Error in record with DUNS {record['duns']}: Invalid DUNS number.")
            else:
                self.records.append(record)
        return errors

    def validate_duns(self, duns):
        return len(duns) == 9 and duns.isdigit()

    def generate_error_codes(self):
        # This can be expanded based on actual error codes
        return "Updated error codes based on validation rules."


class SubmissionDashboardUser:
    def __init__(self):
        self.dashboard = []

    def add_submission(self, submission):
        self.dashboard.append(submission)

    def retrieve_submission_status(self):
        return {submission['duns']: submission['status'] for submission in self.dashboard}


class ProjectManager:
    def __init__(self):
        self.testing_summaries = []
        self.issues = []

    def create_user_testing_summary(self, summary):
        self.testing_summaries.append(summary)

    def track_issues(self, issue):
        self.issues.append(issue)

# Example usage:
if __name__ == "__main__":
    # User submits a valid DUNS
    user = FABSUser()
    print(user.submit_record("123456789", {"name": "Company A"}))  # Submission successful.

    # User submits an invalid DUNS
    print(user.submit_record("12345", {"name": "Company B"}))  # Validation error

    # View submission history
    print(user.view_submission_history())

    # Developer updates validation rules
    developer = Developer(user)
    developer.update_validation_rules(lambda duns: len(duns) == 10 and duns.isdigit())

    # Data user receives updates on records
    data_user = DataUser()
    data_user.records.append({'duns': '123456789', 'updated_today': True})
    print(data_user.receive_updates())  # Should return records updated today

    # Broker uploads and validates multiple records
    broker = Broker()
    errors = broker.upload_and_validate_records([
        {'duns': '123456789', 'data': 'Record 1'},
        {'duns': '12345', 'data': 'Record 2'},
        {'duns': '987654321', 'data': 'Record 3'}
    ])
    print(errors)  # Validation errors for invalid DUNS

    # Submission dashboard user adds and retrieves submission status
    dashboard_user = SubmissionDashboardUser()
    dashboard_user.add_submission({'duns': '123456789', 'status': 'Submitted'})
    print(dashboard_user.retrieve_submission_status())

    # Project manager creates testing summaries and tracks issues
    project_manager = ProjectManager()
    project_manager.create_user_testing_summary("Testing Summary 1")
    project_manager.track_issues("Issue found in testing.")
    print(project_manager.testing_summaries)
    print(project_manager.issues)
